<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Vendor Account Request Update</title>
    <link href="../dist/styles.css" rel="stylesheet">
    <style>
        /* Reset some email client default styles */
        body {
            margin: 0;
            padding: 0;
            background-color: #ffffff;
            font-family: Arial, sans-serif;
        }

        .container {
            max-width: 600px;
            margin: 0 auto;
            padding: 20px;
            /* background-color: #f4f4f4; */
            /* border-radius: 8px; */
            box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
        }

        .button {
            display: block;
            width: fit-content;
            margin: 10px auto;
            padding: 8px 10px;
            background-color: #F77E00;
            color: #ffffff;
            text-decoration: none;
            font-weight: bold;
            border-radius: 5px;
        }

        .button-alt {
            display: block;
            width: fit-content;
            margin: 10px auto;
            background-color: transparent;
            color: #001EBE;
            text-decoration: none;
            font-weight: bold;
        }

        .text {
            color: #3f3f3f;
        }

        .text-black {
            color: #000000;
        }
        .header{
            margin-bottom: 23px;
        }
        .content-section{
            color: #3f3f3f;
            background-color: #f4f4f4;
            padding: 20px 14px;
            border-radius: 10px;
            font-size: 14px;
        }
        .title-text{
            font-weight: 600;
            margin-bottom: 16px;
            font-size: 16px;
        }
    
        a > span {
            color: black;
        }
        
        ul{
            margin: 0 0 16px 20px;
            list-style-type: disc;
        }

        .block-spans {
            display: block;
            margin-bottom: 10px;                        
        }

        @media (min-width: 1024) {
            .container {
                padding: 10px;
            }

            .content-section {
                font-size: 16px;
            }
            .title-text{
                font-size: 28px;
                line-height: 28px;
            }
        }
    </style>
</head>

